      string: '{"success":true,"total_entries":1,"total_pages":1,"page":1,"data":{"exact_show":null,"other_shows":[],"songs":[{"id":330,"title":"Harry
        Hood","alias_for":null,"tracks_count":375,"slug":"harry-hood","updated_at":"2018-12-27T03:40:52Z"}],"venues":[],"tours":[],"tags":[],"show_tags":[],"track_tags":[{"id":72736,"track_id":317,"tag_id":4,"created_at":"2019-04-14T01:02:23.321Z","notes":"Strong
        early \"Hood\" includes a long, slow-tempo intro (to 3:50) with dogs barking
        in the background, and a soaring and unusually long (for this period) Trey-led
        jam, prompting Fishman to comment \"that''s why I''m in the band.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70584,"track_id":487,"tag_id":4,"created_at":"2019-04-14T01:01:07.998Z","notes":"Exceptionally
        powerful early version with excellent Trey/Page interplay and a huge peak.
        A very moving \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71289,"track_id":15063,"tag_id":4,"created_at":"2019-04-14T01:01:32.338Z","notes":"This
        is a terrific compact \"Hood\" with crisp, sharp playing, good interplay,
        and strong Trey. Great sbd recording too.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71717,"track_id":1649,"tag_id":4,"created_at":"2019-04-14T01:01:46.728Z","notes":"The
        jam has an unusual dark, minor mode section from 7:15 - 8:45, making it the
        first truly exploratory \"Hood.\" From here, the jam builds to a strong, shred-filled
        peak.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70238,"track_id":5208,"tag_id":4,"created_at":"2019-04-14T01:00:56.792Z","notes":"Beautiful,
        delicate playing at first. Then at 7:55, there''s an incredible section where
        the power builds in a cool and very unusual way for \"Hood.\" From here, there''s
        a brief settle before launching into a blistering ending.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69900,"track_id":6112,"tag_id":4,"created_at":"2019-04-14T01:00:44.893Z","notes":"\u0026gt;
        in from \"YEM\" during the opening segment. Trey sings one verse of this Dave
        Abrahams'' (childhood friend of Trey''s) song. \u0026gt; back to \"YEM.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72087,"track_id":7560,"tag_id":4,"created_at":"2019-04-14T01:02:01.283Z","notes":"First
        of several strong August ''93 \"Hoods.\" Improvisational and restrained playing
        by Trey shifts at 10:00 when Page plays some low register piano chords, and
        the power starts to surge upward. Fantastic \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71527,"track_id":7313,"tag_id":4,"created_at":"2019-04-14T01:01:40.198Z","notes":"Arguably
        some \"Cities\"-esque chords from Trey, Antelopian HOSE, \"Cocaine\"-esque,
        and \"Harry Hood\"-intro-like jamming, and a glorious dying-out-of-the-theme
        ending. This is quite a version.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71403,"track_id":3908,"tag_id":4,"created_at":"2019-04-14T01:01:36.459Z","notes":"Cool,
        spacey beginning to the jam, great riffs from Trey, strong Fish, and a powerful
        finish with solid trilling = Great \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71852,"track_id":4154,"tag_id":4,"created_at":"2019-04-14T01:01:52.641Z","notes":"Even
        for 1994, this \"Hood\" is a very intense one as Trey shreds like crazy in
        the climactic jam before the closing lyrics.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69747,"track_id":4467,"tag_id":4,"created_at":"2019-04-14T01:00:36.808Z","notes":"The
        first seriously \"Type II\" \"Hood\" includes some very experimental jamming.
        Parts of this exploration are mildly dissonant and very un-\"Hood\"-like,
        while other sections are quite spectacular. The \"Type I\" ending is first
        rate.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69824,"track_id":4531,"tag_id":4,"created_at":"2019-04-14T01:00:40.349Z","notes":"This
        \"Hood\" from A Live One seems to peak, then breaks at 11:25 into a section
        combining ''94 space, moderate dissonance, and loads of tension. When this
        oblique resolves back to normal \"Hood\" at 13:30, it''s pure ''94 bliss.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69851,"track_id":29917,"tag_id":4,"created_at":"2019-04-14T01:00:42.042Z","notes":"One
        quality of many great ''94 \"Hoods\" is their balance of grace and power.
        As the encore from a fantastic show, this \"Hood\" begins with some quiet
        and delicate playing, which pairs nicely with the raw energy and intensity
        of the finish.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71202,"track_id":28542,"tag_id":4,"created_at":"2019-04-14T01:01:29.253Z","notes":"The
        jam includes an unusual and very un-\"Hood\"-like section from 9:00 - 10:50.
        The build and peak sections that follow are strong ''94 fare.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70269,"track_id":5045,"tag_id":4,"created_at":"2019-04-14T01:00:57.770Z","notes":"-\u0026gt;
        in from a monster \"Tweezer.\" Trey brings the volume down to near zero early
        in the jam. Unusual ending with a \u0026gt; to \"Harry Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71875,"track_id":12747,"tag_id":4,"created_at":"2019-04-14T01:01:53.465Z","notes":"The
        jam veers into different territory at 8:45 as the customary \"Hood\" harmonics
        are upended by a shift to minor mode. Returns to normal \"Hood\" after 10:30,
        building to a nice peak which gradually fades with no closing refrain.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71999,"track_id":13536,"tag_id":4,"created_at":"2019-04-14T01:01:58.054Z","notes":"No
        bells or whistles on this \"Hood.\" But the build and peak sections are simply
        gorgeous, even by ''95 standards.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70548,"track_id":12344,"tag_id":4,"created_at":"2019-04-14T01:01:06.770Z","notes":"A
        magnificent jam in this version ends a stellar year for \"Hood.\" Released
        on FTA Superball IX, Part 2.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71900,"track_id":15808,"tag_id":4,"created_at":"2019-04-14T01:01:54.710Z","notes":"Jam
        includes a beautiful and tear jerking Page and Trey duet from 6:40 - 9:55.
        The rest is predictable but solid \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71918,"track_id":26465,"tag_id":4,"created_at":"2019-04-14T01:01:55.433Z","notes":"Karl
        Perazzo on percussion. Wonderfully celebratory \"Hood\" in which Trey hits
        on a cool riff at 9:45 and Page is rock solid.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70278,"track_id":26436,"tag_id":4,"created_at":"2019-04-14T01:00:57.955Z","notes":"A
        magnificent and triumphant version. Check out the superb \"Hood\" from this
        show while you''re at it.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71763,"track_id":16459,"tag_id":4,"created_at":"2019-04-14T01:01:48.708Z","notes":"Top
        notch \"Hood\" follows a stellar \"Simple\" as the \"meat\" of a fantastic
        \"Mike''s Groove.\" The jamming highlights include cool percussion in the
        intro, super Page, lots of syncopation, great power rocking, and a terrific
        peak.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70522,"track_id":16794,"tag_id":4,"created_at":"2019-04-14T01:01:05.959Z","notes":"This
        is really an exceptionally strong \"Hood\" with great Page/Trey interplay,
        great melodies from Trey, super peak, etc. etc.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69456,"track_id":16947,"tag_id":4,"created_at":"2019-04-14T01:00:25.949Z","notes":"This
        majestic and graceful \"Hood\" is very powerful and moving, with soulful,
        delicate teaming by Trey and Page. The peak rises to lofty heights without
        ever losing its elegant beauty. Live Phish Archival Release.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69498,"track_id":17353,"tag_id":4,"created_at":"2019-04-14T01:00:27.568Z","notes":"-\u0026gt;
        in from \"Hood.\" An ambient jam starts as \"Harry\" ends, morphing into an
        exploratory funk-based one. \u0026gt; to \"Forbin.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72667,"track_id":17401,"tag_id":4,"created_at":"2019-04-14T01:02:21.071Z","notes":"Inspired
        by the first ever \"Hood\" glowstick war, Trey leads this fan favorite melodic
        jam to a thrilling peak.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70455,"track_id":17544,"tag_id":4,"created_at":"2019-04-14T01:01:03.769Z","notes":"This
        patient \"Hood\" has an extended and very gradual build. The peaking section
        in the final few minutes is quite glorious.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69518,"track_id":17663,"tag_id":4,"created_at":"2019-04-14T01:00:28.359Z","notes":"The
        jam drifts away from the typical \"Hood\" quiet section into an ambient sort
        of section at 8:45. At 12:15, an excellent, rocking, and non-\"Hood\" rhythm
        kicks in and continues until 13:40, when a huge traditional peak erupts.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69290,"track_id":17901,"tag_id":4,"created_at":"2019-04-14T01:00:19.050Z","notes":"Great
        combination of rocking yet slightly ambient sound from Trey mixed with bluesy
        piano stylings from Page. \u0026gt; to \"Harry Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69560,"track_id":18390,"tag_id":4,"created_at":"2019-04-14T01:00:29.620Z","notes":"Very
        strong Page/Trey interplay, some good variation by Trey, and uniquely ''98
        sound combine for a quality ''98 \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71965,"track_id":18507,"tag_id":4,"created_at":"2019-04-14T01:01:57.152Z","notes":"-\u0026gt;
        in from \"Hood.\" A spacey jam follows \"Harry\" to accompany fireworks marking
        the conclusion of the Lemonwheel Festival. Fish plays the trombone for a portion
        of the jam, which -\u0026gt; to \"Baby Elephant Walk\" (last performed 12/1/92).","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69570,"track_id":18535,"tag_id":4,"created_at":"2019-04-14T01:00:29.959Z","notes":"The
        jam has a very gentle, ambient quality, and the build and peak sections veer
        away from the norm, at moments almost sounding like something other than \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72456,"track_id":18770,"tag_id":4,"created_at":"2019-04-14T01:02:13.437Z","notes":"A
        really nice, low intensity jam emerges on the back end of \"Meat\" proper,
        and continues until \u0026gt; to \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70162,"track_id":19665,"tag_id":4,"created_at":"2019-04-14T01:00:54.404Z","notes":"Very
        nice intro section. The jam is great, and curiously seems to shift back and
        forth between ''99 style high octave playing by Trey, and the predominantly
        power rocking style of ''98. \u0026gt; to \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72204,"track_id":19250,"tag_id":4,"created_at":"2019-04-14T01:02:05.522Z","notes":"35th
        song in the second set is the infamous \"Hood\" fake out. Breakdown at 5:40
        is sicknasty and Trey sounds as fresh as he did in 1983. Second jam features
        a reggae filth groove.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70608,"track_id":20615,"tag_id":4,"created_at":"2019-04-14T01:01:08.781Z","notes":"Robbie
        McCoury on banjo, Ronnie McCoury on mandolin, and Sam Bush on fiddle.  \"Hood\"
        intro -\u0026gt; \"Dog Faced Boy\" \u0026gt; \"Hood.\" Unfortunately the AUD
        recording does not do justice to this cool instrumental arrangement. KS -
        Live Bait Vol. ?","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70609,"track_id":20616,"tag_id":4,"created_at":"2019-04-14T01:01:08.813Z","notes":"-\u0026gt;
        in from the intro to \"Hood.\" Robbie McCoury on banjo, Ronnie McCoury on
        mandolin and Sam Bush on fiddle. \"Dog Faced Boy\" is played in entirety in
        the intro. \u0026gt; back to \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70610,"track_id":20617,"tag_id":4,"created_at":"2019-04-14T01:01:08.844Z","notes":"\u0026gt;
        in from \"Dog Faced Boy.\" This great \"Hood\" now launches, but the AUD recording
        does not do justice to the great and different instrumentation.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70759,"track_id":21716,"tag_id":4,"created_at":"2019-04-14T01:01:13.829Z","notes":"\"Type
        II\" version leaves \"Hood\" at 9:25, breaks into a low-key groove that gets
        rocking, then dissonant, and heads home.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70792,"track_id":21516,"tag_id":4,"created_at":"2019-04-14T01:01:15.214Z","notes":"An
        excellent \"Type II\" section peels away from \"Hood\" at 7:30, continuing
        for a good 5 minutes before coming home.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70800,"track_id":21598,"tag_id":4,"created_at":"2019-04-14T01:01:15.460Z","notes":"Spectacular,
        very \"Type II\" \"Hood.\" Between this one and 7/31/03, the jam here gets
        a further removed from the norm, working through several exploratory sections
        before returning to close. \u0026gt; to an excellent \"David Bowie.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70845,"track_id":21686,"tag_id":4,"created_at":"2019-04-14T01:01:17.252Z","notes":"Must-Hear
        \"Type II\" version. With a more melodic bent than 7/25/03, the jam seems
        to retain at least some vestiges of \"Hood,\" while still ranging far. Returns
        home to conclude. One of the top \"Type II\" jams of ''03 - ''04.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72038,"track_id":21155,"tag_id":4,"created_at":"2019-04-14T01:01:59.403Z","notes":"Jam
        has a nice rocking section beginning about 7:50, returns to \"Hood\" and peaks
        with great struming by Trey.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72054,"track_id":21826,"tag_id":4,"created_at":"2019-04-14T01:01:59.961Z","notes":"This
        \"Hood\" shifts to a rocking \"Type II\" groove at 8:45, briefly returns to
        \"Hood,\" then departs into a dark, rhythmic minor mode section before finally
        coming home to close around 17:25.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69260,"track_id":28189,"tag_id":4,"created_at":"2019-04-14T01:00:17.916Z","notes":"Very
        good, improvisational \"Gin\" with multiple sections. The jam breaks away
        from \"Gin\" proper at 9:30, proceeding through at least 3 movements before
        settling with no return to \"Gin.\" \u0026gt; to \"Harry Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69589,"track_id":23816,"tag_id":4,"created_at":"2019-04-14T01:00:30.603Z","notes":"Excellent
        3.0 version with Trey picking staccato notes, Page matching him on clavinet,
        and Mike and Fish kicking in on this super and very unique rhythmic groove,
        before returning home for a more traditional \"Hood\" ending.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69378,"track_id":28132,"tag_id":4,"created_at":"2019-04-14T01:00:22.996Z","notes":"An
        inspired, full power yet nimbly executed version. Like a great \"Slave\" or
        \"Hood,\" you can really hear Trey and the band pour their hearts into this
        one.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69990,"track_id":25760,"tag_id":4,"created_at":"2019-04-14T01:00:48.732Z","notes":"This
        \"Hood\" has a really nice jam that sounds similar to \"Faht\" at times. Returns
        to \"Hood\" to close.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":69919,"track_id":24448,"tag_id":4,"created_at":"2019-04-14T01:00:46.511Z","notes":"Following
        the vocal jam, the band breaks into a funky groove with a very 2011 sound
        to it (a bit of the staccato or \"plinko\" funk, somewhat similar to the 12/28/11
        \"Cities\") that eventually gets \"Manteca\"-esque before dissolving into
        a spacey jam. \u0026gt; to \"Harry Hood,\" a highly acclaimed combo among
        fans.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70983,"track_id":24958,"tag_id":4,"created_at":"2019-04-14T01:01:21.782Z","notes":"\u0026gt;
        in from an inspired \"Hood.\" A high powered, joyfully played jam continues
        the \"feel good\" from \"Hood.\" \u0026gt; to \"Ghost.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70320,"track_id":24533,"tag_id":4,"created_at":"2019-04-14T01:00:59.155Z","notes":"Some
        really nice variation by Trey throughout the jam, plus a strong ending section
        distinguish this \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":70932,"track_id":25105,"tag_id":4,"created_at":"2019-04-14T01:01:20.087Z","notes":"An
        even better -\u0026gt; out of \"Hood.\" One of the few highlights of the Portsmouth
        2012 shows.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71479,"track_id":25644,"tag_id":4,"created_at":"2019-04-14T01:01:38.679Z","notes":"Both
        sections of this historic version from the \"F-Y-F\" show deserve your attention.
        \"Farmhouse\" proper has an excellent straightforward jam, including rocking
        play similar to the 2/24/03 version, and an extended sustained note from Trey
        akin to what one might hear in a \"Slave\" or \"Hood\" jam. The ambient outro
        jam begins with an introspective sentiment before morphing into techno-rock
        abstraction.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71133,"track_id":27762,"tag_id":4,"created_at":"2019-04-14T01:01:26.846Z","notes":"Great
        interplay, but what really stands out is varied and well-executed soloing
        by Trey as this \"Hood\" builds up power.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71281,"track_id":26976,"tag_id":4,"created_at":"2019-04-14T01:01:32.094Z","notes":"This
        \"Hood\" is a very good one, with a strong building jam, great peak and good
        interplay by the band.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71300,"track_id":27166,"tag_id":4,"created_at":"2019-04-14T01:01:32.677Z","notes":"A
        great straightforward version of \"Waves\" provides a similar uplifting and
        spirit raising boost as a strong \"Hood\" or \"Divided Sky\" does. The soaring
        jam and delicate outro in this fine version from the Gorge underscores this
        point.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72067,"track_id":27253,"tag_id":4,"created_at":"2019-04-14T01:02:00.576Z","notes":"Ground-breaking
        version that ushers in a new era of exploratory \"Hoods.\" After some typical
        play, the jam turns rocking and percussive, including some \"Woo\" jamming.
        Things settle and the play becomes introspective and probing. Turning upbeat
        but with tension, the jam takes a final deep breath and returns to \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72120,"track_id":27505,"tag_id":4,"created_at":"2019-04-14T01:02:02.263Z","notes":"Following
        a strong \"Twist,\" this heartfelt rendering of \"Wading\" provides a graceful
        interlude before a powerful \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71553,"track_id":28776,"tag_id":4,"created_at":"2019-04-14T01:01:41.122Z","notes":"A
        thunderous, powerful, exploratory and very improvisational jam breaks almost
        from the get go. After landing in uncharacteristically darker terrain, the
        jam finds brighter ground, ventures further astray, and finally winds its
        way back to the land of \"Hood.\"","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71546,"track_id":28880,"tag_id":4,"created_at":"2019-04-14T01:01:40.916Z","notes":"This
        \"Hood\" has a really great early section, especially between 5:25 - 9:25,
        where Mike, Page and Trey have this wonderful 3-way musical conversation,
        while Fish scales the percussion down to a very subtle but key rhythmic foundation.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71572,"track_id":29300,"tag_id":4,"created_at":"2019-04-14T01:01:41.770Z","notes":"\"Harry\"
        once again proves to be the improbable choice for exploratory jamming. This
        time, the band begins the jam in minor mode, works up to a rocking fury, and
        finally settles back for a traditional \"Hood\" closing.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":71587,"track_id":29061,"tag_id":4,"created_at":"2019-04-14T01:01:42.319Z","notes":"While
        not as exploratory as some from Summer ''14, this \"Hood\" is by no means
        a typical. The jam includes great Trey licks, rocking chording, strong Mike
        and Page, and a solid peak.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72259,"track_id":29207,"tag_id":4,"created_at":"2019-04-14T01:02:07.247Z","notes":"The
        band has fun, as Trey plays duets with Mike, Fish, and Page. Then Mike plays
        the fight bell while Trey plays rhythm on the mike. Once fully back in \"Hood,\"
        the jam breaks into minor mode, recalling the strong exploratory versions
        from earlier in the summer.","starts_at_second":null,"ends_at_second":null,"transcript":null},{"id":72012,"track_id":29543,"tag_id":4,"created_at":"2019-04-14T01:01:58.585Z","notes":"Amidst
